import express from 'express';
import puppeteer from 'puppeteer';
import path from 'path';
import { fileURLToPath } from 'url';
import bodyParser from 'body-parser';

const __dirname = path.dirname(fileURLToPath(import.meta.url));
const app = express();
app.use(bodyParser.urlencoded({ extended: true }));
app.use(express.static(__dirname));

app.get("/", (req, res) => {
  res.sendFile(path.join(__dirname, "form.html"));
});

app.post("/generate-pdf", async (req, res) => {
  const data = req.body;
  const time = `${data.hour}:${data.minute}`;
  const hun = data.hungarian === "igen";
  const showCustom = data.displayOption === "custom";
  const showText = showCustom ? data.customText : `${data.kiszalldij} Ft`;

  const htmlContent = `
    <html>
    <head>
      <style>
        @import url('https://fonts.googleapis.com/css2?family=Playfair+Display&display=swap');
        body {
          font-family: 'Playfair Display', serif;
          padding: 50px;
          font-size: 13pt;
          color: #333;
        }
        h1 {
          font-size: 24pt;
          margin-bottom: 10px;
          color: #c29898;
        }
        h2 {
          font-size: 18pt;
          margin-top: 30px;
          color: #a27878;
        }
        ul {
          padding-left: 20px;
          line-height: 1.6;
        }
        .row {
          display: flex;
          justify-content: space-between;
        }
        .right-img {
          max-width: 40%;
          margin-left: 30px;
          align-self: flex-start;
        }
        .logo {
          width: 140px;
          margin-bottom: 30px;
        }
      </style>
    </head>
    <body>
      <img class="logo" src="data:image/png;base64,">
      <h1>Kedves ${data.bride} & ${data.groom}!</h1>
      <p>rmmel kldm el szertartsvezeti ajnlatomat a magyar nyelv eskvtkhz. Az Angel Ceremony ltal meglmodott 30 perc varzslat lesz  egy felejthetetlen lmny, ami megalapozza az egsz nap nnepi hangulatt.</p>

      <h2>Az eskv rszletei</h2>
      <div class="row">
        <ul>
          <li>Dtum: ${data.date}</li>
          <li>Idpont: ${time}</li>
          <li>Helyszn: ${data.location}</li>
          <li>Tvolsg: ${data.distance} km</li>
          <li>Vendgek szma: ${data.guests} f</li>
          <li>Csomag: ${data.selectedPackage}</li>
          <li>${hun ? "Kiszllsi dj" : "Utazsi kltsg"}: ${showText}</li>
        </ul>
        <img class="right-img" src="data:image/png;base64,">
      </div>

      <h2>Szemlyre szabott ceremnia</h2>
      <p>Az eskvtk napja egy letre szl kzs emlk lesz  s minden egyes pillanata rlatok fog szlni. ltalam vezetett szertarts mindig teljesen szemlyre szabott, ezrt nincs kt egyforma eskets.</p>
      <p>Az els egyeztets sorn (szemlyesen vagy online) tbeszljk az elkpzelseiteket, tnzzk a szerzdst s tisztzzuk a rszleteket. Ezt kveten mindketten rtok nekem egy e-mailt, amiben megosztjtok a megismerkedsetek trtnett, fontos momentumokat, s minden olyan informcit, ami egy igazn benssges szertartshoz szksges  belertve a fogadalmat, kzs momentumot vagy szlkszntt is.</p>
      <p>A szertartsotok forgatknyvt, zenei koreogrfijt is kzsen alaktjuk ki  gy, hogy az valban a ti trtneteteket meslje el.</p>
      <p><strong>Fontos tudnival:</strong> Szertartsvezetknt szimbolikus esketst tartok, amelyhez szksges, hogy az anyaknyvi hzassgkts mr korbban megtrtnt, legalbb 30 nappal eltte jelezve a hzassgktsi szndkot az illetkes hivatalnl.<br>
      A hivatalos anyaknyvi kivonatot krlek, kldjtek el e-mailben lefotzva legksbb az eskv eltt 5 nappal (szksg esetn akr az eskv napjn is elfogadom).</p>
    </body>
    </html>
  `;

  const browser = await puppeteer.launch({ headless: "new" });
  const page = await browser.newPage();
  await page.setContent(htmlContent, { waitUntil: "networkidle0" });
  const pdfBuffer = await page.pdf({ format: "A4", printBackground: true });
  await browser.close();

  res.contentType("application/pdf");
  res.send(pdfBuffer);
});

const PORT = process.env.PORT || 8080;
app.listen(PORT, () => {
  console.log("Szerver fut a " + PORT + " porton");
});